import React from 'react';
import './PatientSidebar.css';

const PatientSidebar = ({ setActiveSection }) => {
    return (
        <div className="patient-sidebar">
            <div className="sidebar-header">
                <h3>Patient Dashboard</h3>
            </div>
            <ul className="sidebar-menu">
                <li onClick={() => setActiveSection('patientInfo')}>View Profile</li>
                <li onClick={() => setActiveSection('medicalRecords')}>Medical Records</li>
                <li onClick={() => setActiveSection('appointments')}>Appointments</li>
            </ul>
            <div className="logout-btn">
                <button className="logout-button">Logout</button>
            </div>
        </div>
    );
};

export default PatientSidebar;
